import { Routes, Route, Link } from 'react-router-dom'
import Home from'./Home';
import Date from'./Date';
import News from'./News';
import Login from'./Login';
import Topic from'./Topic';
import Editor from'./Editor';
import { useState } from 'react';
import Signup from './Signup';
import UserArticles from './User/UserArticles';
import NewArticle from './User/NewArticle';
import UserConf from './User/UserConf';

function Navbar() { 
  const [token, setToken] = useState(null)
  const [id, setId] = useState(null)

 return(
 <div>
  <nav>
    <Link className="link" to="/">Inicio</Link>
    <Link className="link" to="/news">News</Link>
    <Link className="link" to="/date">Date</Link>
    <Link className="link" to="/topic">Topic</Link>
    <span>
    { token ? <Link className="link" to="/logout">Logout</Link>
    : <Link className="link" to="/login">Login</Link> }
    </span>
  </nav>
  { token ? <></>: 
  <nav className='userNavBar'>
    <Link className="link" to="/newarticle">New article</Link>
    <Link className="link" to="/userarticles">My articles</Link>
    <span>
    <Link className="link" to="/userconf">Edit Profile</Link>
    </span>
  </nav>}
 <Routes>
   <Route path="/" exact element={<Home/>} />
   <Route path="/news" element={<News />} />
   <Route path="/date" element={<Date />} />
   <Route path="/topic" element={<Topic />} />
   <Route path="/editor" element={<Editor token= {token}/>} />
   <Route path="/userconf" element={<UserConf token= {token} id= {id} />} />
   <Route path="/login" element={<Login setToken = {setToken} setId={setId}/>} />
   <Route path="/signup" element={<Signup />} />
   <Route path="/newarticle" element={<NewArticle token= {token}/>} />
   <Route path="/userarticles" element={<UserArticles token= {token}/>} />
   <Route path="/logout" element={<UserArticles token= {token}/>} />
 </Routes>
</div>
    
)}

export default Navbar;
